#include "include.cuh"
#include "System.cuh"

__device__ double4 ancf_shape_derivative_x(double x, double a)
{
  double xi = x/a;
  return make_double4((6*xi*xi-6*xi)/a,1-4*xi+3*xi*xi,-(6*xi*xi-6*xi)/a,-2*xi+3*xi*xi);
}

__device__ double4 ancf_shape_derivative2_x(double x, double a)
{
  double xi = x/a;
  return make_double4((12*xi-6)/(a*a),(-4+6*xi)/a,(6-12*xi)/(a*a),(-2+6*xi)/a);
}

__global__ void strainDerivativeUpdate(double ptj, double* p, double* strain, double* strainD, double3* geometries, int numBodies, int numBeams)
{
  INIT_CHECK_THREAD_BOUNDED(INDEX1D, numBeams);

  double a = geometries[index+numBodies].y;

  double x = .5*a*(1.+ptj);

  p = &p[12*index+3*numBodies];
  strainD = &strainD[12*index];

  double e0  = p[0];
  double e1  = p[1];
  double e2  = p[2];
  double e3  = p[3];
  double e4  = p[4];
  double e5  = p[5];
  double e6  = p[6];
  double e7  = p[7];
  double e8  = p[8];
  double e9  = p[9];
  double e10 = p[10];
  double e11 = p[11];

  double4 S = ancf_shape_derivative_x(x,a);

  strain[index] = S.w*(S.w*(e9*e9+e10*e10+e11*e11)+S.x*(e0*e9+e1*e10+e2*e11)+S.y*(e3*e9+e4*e10+e5*e11)+S.z*(e6*e9+e7*e10+e8*e11))*(1.0/2.0)+S.x*(S.x*(e0*e0+e1*e1+e2*e2)+S.w*(e0*e9+e1*e10+e2*e11)+S.y*(e0*e3+e1*e4+e2*e5)+S.z*(e0*e6+e1*e7+e2*e8))*(1.0/2.0)+S.y*(S.y*(e3*e3+e4*e4+e5*e5)+S.w*(e3*e9+e4*e10+e5*e11)+S.x*(e0*e3+e1*e4+e2*e5)+S.z*(e3*e6+e4*e7+e5*e8))*(1.0/2.0)+S.z*(S.z*(e6*e6+e7*e7+e8*e8)+S.w*(e6*e9+e7*e10+e8*e11)+S.x*(e0*e6+e1*e7+e2*e8)+S.y*(e3*e6+e4*e7+e5*e8))*(1.0/2.0)-1.0/2.0;

  strainD[0] = S.x*(S.w*e9+S.x*e0+S.y*e3+S.z*e6);
  strainD[1] = S.x*(S.w*e10+S.x*e1+S.y*e4+S.z*e7);
  strainD[2] = S.x*(S.w*e11+S.x*e2+S.y*e5+S.z*e8);
  strainD[3] = S.y*(S.w*e9+S.x*e0+S.y*e3+S.z*e6);
  strainD[4] = S.y*(S.w*e10+S.x*e1+S.y*e4+S.z*e7);
  strainD[5] = S.y*(S.w*e11+S.x*e2+S.y*e5+S.z*e8);
  strainD[6] = S.z*(S.w*e9+S.x*e0+S.y*e3+S.z*e6);
  strainD[7] = S.z*(S.w*e10+S.x*e1+S.y*e4+S.z*e7);
  strainD[8] = S.z*(S.w*e11+S.x*e2+S.y*e5+S.z*e8);
  strainD[9] = S.w*(S.w*e9+S.x*e0+S.y*e3+S.z*e6);
  strainD[10] = S.w*(S.w*e10+S.x*e1+S.y*e4+S.z*e7);
  strainD[11] = S.w*(S.w*e11+S.x*e2+S.y*e5+S.z*e8);
}

__global__ void calculateInitialStrainBeam(double ptj, double* p, int quadIndex, int numQuad, double* strain, double3* geometries, int numBodies, int numBeams)
{
  INIT_CHECK_THREAD_BOUNDED(INDEX1D, numBeams);

  double a = geometries[index+numBodies].y;

  double x = .5*a*(1.+ptj);

  p = &p[12*index+3*numBodies];

  double e0  = p[0];
  double e1  = p[1];
  double e2  = p[2];
  double e3  = p[3];
  double e4  = p[4];
  double e5  = p[5];
  double e6  = p[6];
  double e7  = p[7];
  double e8  = p[8];
  double e9  = p[9];
  double e10 = p[10];
  double e11 = p[11];

  double4 S = ancf_shape_derivative_x(x,a);

  strain[numQuad*index+quadIndex] = S.w*(S.w*(e9*e9+e10*e10+e11*e11)+S.x*(e0*e9+e1*e10+e2*e11)+S.y*(e3*e9+e4*e10+e5*e11)+S.z*(e6*e9+e7*e10+e8*e11))*(1.0/2.0)+S.x*(S.x*(e0*e0+e1*e1+e2*e2)+S.w*(e0*e9+e1*e10+e2*e11)+S.y*(e0*e3+e1*e4+e2*e5)+S.z*(e0*e6+e1*e7+e2*e8))*(1.0/2.0)+S.y*(S.y*(e3*e3+e4*e4+e5*e5)+S.w*(e3*e9+e4*e10+e5*e11)+S.x*(e0*e3+e1*e4+e2*e5)+S.z*(e3*e6+e4*e7+e5*e8))*(1.0/2.0)+S.z*(S.z*(e6*e6+e7*e7+e8*e8)+S.w*(e6*e9+e7*e10+e8*e11)+S.x*(e0*e6+e1*e7+e2*e8)+S.y*(e3*e6+e4*e7+e5*e8))*(1.0/2.0)-1.0/2.0;
}

__global__ void curvatDerivUpdate(double ptj, double* p, double* k, double* ke, double3* geometries, int numBodies, int numBeams)
{
  INIT_CHECK_THREAD_BOUNDED(INDEX1D, numBeams);

  double a = geometries[index+numBodies].y;
  double x = .5*a*(1.+ptj);

  p = &p[12*index+3*numBodies];
  ke = &ke[12*index];

  double e0  = p[0];
  double e1  = p[1];
  double e2  = p[2];
  double e3  = p[3];
  double e4  = p[4];
  double e5  = p[5];
  double e6  = p[6];
  double e7  = p[7];
  double e8  = p[8];
  double e9  = p[9];
  double e10 = p[10];
  double e11 = p[11];

  double4 S = ancf_shape_derivative_x(x,a);
  double4 SS = ancf_shape_derivative2_x(x,a);

  double3 rx = make_double3(S.w*e9+S.x*e0+S.y*e3+S.z*e6,S.w*e10+S.x*e1+S.y*e4+S.z*e7,S.w*e11+S.x*e2+S.y*e5+S.z*e8);
  double3 rxx = make_double3(SS.x*e0+SS.y*e3+SS.w*e9+SS.z*e6,SS.x*e1+SS.y*e4+SS.w*e10+SS.z*e7,SS.x*e2+SS.y*e5+SS.w*e11+SS.z*e8);

  double g1 = sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0));
  double g = pow(g1,3.0);

  double3 f1 = make_double3(rx.y*rxx.z-rx.z*rxx.y,-rx.x*rxx.z+rx.z*rxx.x,rx.x*rxx.y-rx.y*rxx.x);

  double f = sqrt(pow(fabs(rx.x*rxx.y-rx.y*rxx.x),2.0)+pow(fabs(rx.x*rxx.z-rx.z*rxx.x),2.0)+pow(fabs(rx.y*rxx.z-rx.z*rxx.y),2.0));

  k[index] = f/g;

  double fspecial = 1.0;
  if(f) fspecial = fspecial/f;

  ke[0] = 1.0/(g*g)*(g*(fspecial*(S.x*rxx.y-SS.x*rx.y)*(rx.x*rxx.y-rx.y*rxx.x)+fspecial*(S.x*rxx.z-SS.x*rx.z)*(rx.x*rxx.z-rx.z*rxx.x))-S.x*f*(S.w*e9*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e0*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e3*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e6*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[1] = -1.0/(g*g)*(g*(fspecial*(S.x*rxx.x-SS.x*rx.x)*(rx.x*rxx.y-rx.y*rxx.x)-fspecial*(S.x*rxx.z-SS.x*rx.z)*(rx.y*rxx.z-rx.z*rxx.y))+S.x*f*(S.w*e10*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e1*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e4*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e7*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[2] = -1.0/(g*g)*(g*(fspecial*(S.x*rxx.x-SS.x*rx.x)*(rx.x*rxx.z-rx.z*rxx.x)+fspecial*(S.x*rxx.y-SS.x*rx.y)*(rx.y*rxx.z-rx.z*rxx.y))+S.x*f*(S.w*e11*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e2*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e5*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e8*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[3] = 1.0/(g*g)*(g*(fspecial*(S.y*rxx.y-SS.y*rx.y)*(rx.x*rxx.y-rx.y*rxx.x)+fspecial*(S.y*rxx.z-SS.y*rx.z)*(rx.x*rxx.z-rx.z*rxx.x))-S.y*f*(S.w*e9*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e0*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e3*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e6*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[4] = -1.0/(g*g)*(g*(fspecial*(S.y*rxx.x-SS.y*rx.x)*(rx.x*rxx.y-rx.y*rxx.x)-fspecial*(S.y*rxx.z-SS.y*rx.z)*(rx.y*rxx.z-rx.z*rxx.y))+S.y*f*(S.w*e10*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e1*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e4*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e7*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[5] = -1.0/(g*g)*(g*(fspecial*(S.y*rxx.x-SS.y*rx.x)*(rx.x*rxx.z-rx.z*rxx.x)+fspecial*(S.y*rxx.y-SS.y*rx.y)*(rx.y*rxx.z-rx.z*rxx.y))+S.y*f*(S.w*e11*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e2*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e5*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e8*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[6] = 1.0/(g*g)*(g*(fspecial*(S.z*rxx.y-SS.z*rx.y)*(rx.x*rxx.y-rx.y*rxx.x)+fspecial*(S.z*rxx.z-SS.z*rx.z)*(rx.x*rxx.z-rx.z*rxx.x))-S.z*f*(S.w*e9*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e0*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e3*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e6*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[7] = -1.0/(g*g)*(g*(fspecial*(S.z*rxx.x-SS.z*rx.x)*(rx.x*rxx.y-rx.y*rxx.x)-fspecial*(S.z*rxx.z-SS.z*rx.z)*(rx.y*rxx.z-rx.z*rxx.y))+S.z*f*(S.w*e10*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e1*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e4*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e7*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[8] = -1.0/(g*g)*(g*(fspecial*(S.z*rxx.x-SS.z*rx.x)*(rx.x*rxx.z-rx.z*rxx.x)+fspecial*(S.z*rxx.y-SS.z*rx.y)*(rx.y*rxx.z-rx.z*rxx.y))+S.z*f*(S.w*e11*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e2*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e5*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e8*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[9] = 1.0/(g*g)*(g*(fspecial*(S.w*rxx.y-SS.w*rx.y)*(rx.x*rxx.y-rx.y*rxx.x)+fspecial*(S.w*rxx.z-SS.w*rx.z)*(rx.x*rxx.z-rx.z*rxx.x))-S.w*f*(S.w*e9*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e0*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e3*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e6*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[10] = -1.0/(g*g)*(g*(fspecial*(S.w*rxx.x-SS.w*rx.x)*(rx.x*rxx.y-rx.y*rxx.x)-fspecial*(S.w*rxx.z-SS.w*rx.z)*(rx.y*rxx.z-rx.z*rxx.y))+S.w*f*(S.w*e10*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e1*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e4*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e7*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
  ke[11] = -1.0/(g*g)*(g*(fspecial*(S.w*rxx.x-SS.w*rx.x)*(rx.x*rxx.z-rx.z*rxx.x)+fspecial*(S.w*rxx.y-SS.w*rx.y)*(rx.y*rxx.z-rx.z*rxx.y))+S.w*f*(S.w*e11*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.x*e2*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.y*e5*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0+S.z*e8*sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0))*3.0));
}

__global__ void calculateInitialCurvatureBeam(double ptj, double* p, int quadIndex, int numQuad, double* k, double3* geometries, int numBodies, int numBeams)
{
  INIT_CHECK_THREAD_BOUNDED(INDEX1D, numBeams);

  double a = geometries[index+numBodies].y;
  double x = .5*a*(1.+ptj);

  p = &p[12*index+3*numBodies];

  double e0  = p[0];
  double e1  = p[1];
  double e2  = p[2];
  double e3  = p[3];
  double e4  = p[4];
  double e5  = p[5];
  double e6  = p[6];
  double e7  = p[7];
  double e8  = p[8];
  double e9  = p[9];
  double e10 = p[10];
  double e11 = p[11];

  double4 S = ancf_shape_derivative_x(x,a);
  double4 SS = ancf_shape_derivative2_x(x,a);

  double3 rx = make_double3(S.w*e9+S.x*e0+S.y*e3+S.z*e6,S.w*e10+S.x*e1+S.y*e4+S.z*e7,S.w*e11+S.x*e2+S.y*e5+S.z*e8);
  double3 rxx = make_double3(SS.x*e0+SS.y*e3+SS.w*e9+SS.z*e6,SS.x*e1+SS.y*e4+SS.w*e10+SS.z*e7,SS.x*e2+SS.y*e5+SS.w*e11+SS.z*e8);

  double g1 = sqrt(pow(fabs(rx.x),2.0)+pow(fabs(rx.y),2.0)+pow(fabs(rx.z),2.0));
  double g = pow(g1,3.0);

  double3 f1 = make_double3(rx.y*rxx.z-rx.z*rxx.y,-rx.x*rxx.z+rx.z*rxx.x,rx.x*rxx.y-rx.y*rxx.x);

  double f = sqrt(pow(fabs(rx.x*rxx.y-rx.y*rxx.x),2.0)+pow(fabs(rx.x*rxx.z-rx.z*rxx.x),2.0)+pow(fabs(rx.y*rxx.z-rx.z*rxx.y),2.0));

  k[numQuad*index+quadIndex] = f/g;
}

__global__ void addInternalForceComponent(double* f, double* strainEnergy, double* strainD_shared, double* strainVec, int quadIndex, int numQuad, double* strain0, double3* materials, double3* geometries, double wtl, int numBodies, int numBeams, int check)
{
  INIT_CHECK_THREAD_BOUNDED(INDEX1D, numBeams);

  double strain = strainVec[index]-strain0[numQuad*index+quadIndex];
  double3 geometry = geometries[index+numBodies];
  double E = materials[index].y;
  double a = geometry.y;
  double r = geometry.x;
  double A = PI*r*r;
  double I = .25*PI*r*r*r*r;

  f = &f[12*index+3*numBodies];
  strainD_shared = &strainD_shared[12*index];
  double factor = wtl*A*E*a*.5;
  if(check) factor = wtl*I*E*a*.5;

  strainEnergy[index] += factor * strain * strain;
  f[0] += factor * strain * strainD_shared[0];
  f[1] += factor * strain * strainD_shared[1];
  f[2] += factor * strain * strainD_shared[2];
  f[3] += factor * strain * strainD_shared[3];
  f[4] += factor * strain * strainD_shared[4];
  f[5] += factor * strain * strainD_shared[5];
  f[6] += factor * strain * strainD_shared[6];
  f[7] += factor * strain * strainD_shared[7];
  f[8] += factor * strain * strainD_shared[8];
  f[9] += factor * strain * strainD_shared[9];
  f[10] += factor * strain * strainD_shared[10];
  f[11] += factor * strain * strainD_shared[11];
}

