__device__ int ancf_shape_derivative_x(double* Sx, double x, double y, double a, double b)
{
  Sx[0] = - (y / b - 1) / a * ( (2 * y * y *  pow( b,  (-2))) -  (y / b) + 0.2e1 * x * x * pow(a, -0.2e1) - x / a - 0.1e1 + (x / a - 0.1e1) * (0.4e1 * x / a - 0.1e1));
