int System::updateElasticForces()
{
  thrust::fill(fElastic_d.begin(),fElastic_d.end(),0.0); //Clear internal forces
  thrust::fill(strainEnergy_d.begin(),strainEnergy_d.end(),0.0); //Clear beam energy
  thrust::fill(strainEnergyPlate_d.begin(),strainEnergyPlate_d.end(),0.0); //Clear plate energy

  if(beams.size()) {
    for(int j=0;j<pt5.size();j++)
    {
      strainDerivativeUpdate<<<BLOCKS(beams.size()),THREADS>>>(pt5[j],CASTD1(p_d),CASTD1(strain_d),CASTD1(strainDerivative_d),CASTD3(contactGeometry_d),bodies.size(),beams.size());
      addInternalForceComponent<<<BLOCKS(beams.size()),THREADS>>>(CASTD1(fElastic_d),CASTD1(strainEnergy_d),CASTD1(strainDerivative_d),CASTD1(strain_d),j,pt5.size(),CASTD1(strainBeam0_d),CASTD3(materialsBeam_d),CASTD3(contactGeometry_d),wt5[j],bodies.size(),beams.size(),0);
    }

    for(int j=0;j<pt3.size();j++)
    {
      curvatDerivUpdate<<<BLOCKS(beams.size()),THREADS>>>(pt3[j],CASTD1(p_d),CASTD1(strain_d),CASTD1(strainDerivative_d),CASTD3(contactGeometry_d),bodies.size(),beams.size());
      addInternalForceComponent<<<BLOCKS(beams.size()),THREADS>>>(CASTD1(fElastic_d),CASTD1(strainEnergy_d),CASTD1(strainDerivative_d),CASTD1(strain_d),j,pt3.size(),CASTD1(curvatureBeam0_d),CASTD3(materialsBeam_d),CASTD3(contactGeometry_d),wt3[j],bodies.size(),beams.size(),1);
    }
  }

  if(plates.size()) {
    for(int j=0;j<pt6.size();j++)
    {
      for(int k=0;k<wt6.size();k++)
      {
        strainDerivativeUpdatePlate<<<BLOCKS(plates.size()),THREADS>>>(pt6[j],pt6[k],CASTD1(p_d),CASTD3(strainPlate_d),CASTD3(strainDerivativePlate_d),CASTD1(Sx_d),CASTD1(Sy_d),CASTD3(contactGeometry_d),bodies.size(),beams.size(),plates.size());
        addInternalForceComponentPlate<<<BLOCKS(plates.size()),THREADS>>>(CASTD1(fElastic_d),CASTD1(strainEnergyPlate_d),CASTD3(strainDerivativePlate_d),CASTD3(strainPlate_d),j*pt6.size()+k,pt6.size()*wt6.size(),CASTD3(strainPlate0_d),CASTD4(materialsPlate_d),CASTD3(contactGeometry_d),wt6[j]*wt6[k],bodies.size(),beams.size(),plates.size(),0);
      }
    }

    for(int j=0;j<pt5.size();j++)
    {
      for(int k=0;k<wt5.size();k++)
      {
        curvatDerivUpdatePlate<<<BLOCKS(plates.size()),THREADS>>>(pt5[j],pt5[k],CASTD1(p_d),CASTD3(strainPlate_d),CASTD3(strainDerivativePlate_d),CASTD3(curvatureDerivativePlate_d),CASTD1(Sx_d),CASTD1(Sy_d),CASTD1(Sxx_d),CASTD1(Syy_d),CASTD3(contactGeometry_d),bodies.size(),beams.size(),plates.size());
        addInternalForceComponentPlate<<<BLOCKS(plates.size()),THREADS>>>(CASTD1(fElastic_d),CASTD1(strainEnergyPlate_d),CASTD3(strainDerivativePlate_d),CASTD3(strainPlate_d),j*pt5.size()+k,pt5.size()*wt5.size(),CASTD3(curvaturePlate0_d),CASTD4(materialsPlate_d),CASTD3(contactGeometry_d),wt5[j]*wt5[k],bodies.size(),beams.size(),plates.size(),1);
      }
    }
  }

  if(nodes_h.size()) {
    fElasticShellMesh_d.resize(36*shellConnectivities_h.size());
    thrust::fill(fElasticShellMesh_d.begin(),fElasticShellMesh_d.end(),0.0); //Clear internal forces
    thrust::fill(strainEnergyShellMesh_d.begin(),strainEnergyShellMesh_d.end(),0.0); //Clear shell mesh energy
    shellMap_d.resize(shellMap0_d.size());
    thrust::copy(shellMap0_d.begin(), shellMap0_d.end(), shellMap_d.begin());
    int offset_shellMesh = plates.size()*36+12*beams.size()+3*bodies.size()+3*body2Ds.size();
    for(int j=0;j<pt6.size();j++)
    {
      for(int k=0;k<wt6.size();k++)
      {
        strainDerivativeUpdateShellMesh<<<BLOCKS(shellConnectivities_h.size()),THREADS>>>(pt6[j],pt6[k],CASTD1(p_d),CASTI4(shellConnectivities_d),CASTD3(strainShellMesh_d),CASTD3(strainDerivativeShellMesh_d),CASTD1(Sx_shellMesh_d),CASTD1(Sy_shellMesh_d),CASTD4(shellGeometries_d),offset_shellMesh,shellConnectivities_h.size());
        addInternalForceComponentShellMesh<<<BLOCKS(shellConnectivities_h.size()),THREADS>>>(CASTD1(fElasticShellMesh_d),CASTD1(strainEnergyShellMesh_d),CASTD3(strainDerivativeShellMesh_d),CASTD3(strainShellMesh_d),j*pt6.size()+k,pt6.size()*wt6.size(),CASTD3(strainShellMesh0_d),CASTD4(shellMaterials_d),CASTD4(shellGeometries_d),wt6[j]*wt6[k],shellConnectivities_h.size(),0);
      }
    }

    for(int j=0;j<pt5.size();j++)
    {
      for(int k=0;k<wt5.size();k++)
      {
        curvatDerivUpdateShellMesh<<<BLOCKS(shellConnectivities_h.size()),THREADS>>>(pt5[j],pt5[k],CASTD1(p_d),CASTI4(shellConnectivities_d),CASTD3(strainShellMesh_d),CASTD3(strainDerivativeShellMesh_d),CASTD3(curvatureDerivativeShellMesh_d),CASTD1(Sx_shellMesh_d),CASTD1(Sy_shellMesh_d),CASTD1(Sxx_shellMesh_d),CASTD1(Syy_shellMesh_d),CASTD4(shellGeometries_d),offset_shellMesh,shellConnectivities_h.size());
        addInternalForceComponentShellMesh<<<BLOCKS(shellConnectivities_h.size()),THREADS>>>(CASTD1(fElasticShellMesh_d),CASTD1(strainEnergyShellMesh_d),CASTD3(strainDerivativeShellMesh_d),CASTD3(strainShellMesh_d),j*pt5.size()+k,pt5.size()*wt5.size(),CASTD3(curvatureShellMesh0_d),CASTD4(shellMaterials_d),CASTD4(shellGeometries_d),wt5[j]*wt5[k],shellConnectivities_h.size(),1);
      }
    }

    thrust::sort_by_key(shellMap_d.begin(), shellMap_d.end(), fElasticShellMesh_d.begin());
    thrust::reduce_by_key(shellMap_d.begin(), shellMap_d.end(), fElasticShellMesh_d.begin(), shellMap_d.begin(), fElasticShellMesh_d.begin());
    thrust::copy(fElasticShellMesh_d.begin(),fElasticShellMesh_d.begin()+3*nodes_h.size(),fElastic_d.begin()+offset_shellMesh);
  }

  return 0;
}

int System::calculateInitialStrainAndCurvature() {
  if(beams.size()) {
    for(int j=0;j<pt5.size();j++)
    {
      calculateInitialStrainBeam<<<BLOCKS(beams.size()),THREADS>>>(pt5[j],CASTD1(p_d),j,pt5.size(),CASTD1(strainBeam0_d),CASTD3(contactGeometry_d),bodies.size(),beams.size());
    }

    for(int j=0;j<pt3.size();j++)
    {
      calculateInitialCurvatureBeam<<<BLOCKS(beams.size()),THREADS>>>(pt3[j],CASTD1(p_d),j,pt3.size(),CASTD1(curvatureBeam0_d),CASTD3(contactGeometry_d),bodies.size(),beams.size());
    }
  }

  if(plates.size()) {
    for(int j=0;j<pt6.size();j++)
    {
      for(int k=0;k<wt6.size();k++)
      {
        calculateInitialStrainPlate<<<BLOCKS(plates.size()),THREADS>>>(pt6[j],pt6[k],CASTD1(p_d),j*pt6.size()+k,pt6.size()*wt6.size(),CASTD3(strainPlate0_d),CASTD1(Sx_d),CASTD1(Sy_d),CASTD3(contactGeometry_d),bodies.size(),beams.size(),plates.size());
      }
    }

    for(int j=0;j<pt5.size();j++)
    {
      for(int k=0;k<wt5.size();k++)
      {
        calculateInitialCurvaturePlate<<<BLOCKS(plates.size()),THREADS>>>(pt5[j],pt5[k],CASTD1(p_d),j*pt5.size()+k,pt5.size()*wt5.size(),CASTD3(curvaturePlate0_d),CASTD1(Sx_d),CASTD1(Sy_d),CASTD1(Sxx_d),CASTD1(Syy_d),CASTD3(contactGeometry_d),bodies.size(),beams.size(),plates.size());
      }
    }
  }

  if(nodes_h.size()) {
    int offset_shellMesh = plates.size()*36+12*beams.size()+3*bodies.size()+3*body2Ds.size();
    for(int j=0;j<pt6.size();j++)
    {
      for(int k=0;k<wt6.size();k++)
      {
        calculateInitialStrainShellMesh<<<BLOCKS(shellConnectivities_h.size()),THREADS>>>(pt6[j],pt6[k],CASTD1(p_d),CASTI4(shellConnectivities_d),j*pt6.size()+k,pt6.size()*wt6.size(),CASTD3(strainShellMesh0_d),CASTD1(Sx_shellMesh_d),CASTD1(Sy_shellMesh_d),CASTD4(shellGeometries_d),offset_shellMesh,shellConnectivities_h.size());
      }
    }

    for(int j=0;j<pt5.size();j++)
    {
      for(int k=0;k<wt5.size();k++)
      {
        calculateInitialCurvatureShellMesh<<<BLOCKS(shellConnectivities_h.size()),THREADS>>>(pt5[j],pt5[k],CASTD1(p_d),CASTI4(shellConnectivities_d),j*pt5.size()+k,pt5.size()*wt5.size(),CASTD3(curvatureShellMesh0_d),CASTD1(Sx_shellMesh_d),CASTD1(Sy_shellMesh_d),CASTD1(Sxx_shellMesh_d),CASTD1(Syy_shellMesh_d),CASTD4(shellGeometries_d),offset_shellMesh,shellConnectivities_h.size());
      }
    }
  }

  return 0;
}
